import pdfMake from "pdfmake/build/pdfmake";
// import pdfFonts from "pdfmake/build/vfs_fonts";

const generatePdf = async (estudiante) => {
    const HELPERS = {
        crearBrs: (numero_de_brs) => new Array(numero_de_brs).fill(' '),
        getFecha: () => {
            const fecha = new Date().toLocaleDateString('es-ES', {
                weekday: 'long',
                day: 'numeric',
                month: 'long',
                year: 'numeric'
            });
            return `Informe  del ${fecha}`
        }
    }
    const generarTabla = tipo => {
        const headers = ['HORARIO', 'MATERIA', 'DOCENTE', 'ASISTIO', 'ENTREGO TAREA', 'TAREA ASIGANADA PARA ENTREGAR OTRO DIA']
        const alignment = 'center';
        const INFORMACION = {
            GENERAL: {
                width: ['50%', '50%'],
                titulo: 'INFORMACIÓN GENERAL',
                css: {},
                titleSpan: 2,
                getColumnas: () => {
                    return [
                        ['Total de clases', { text: estudiante.general.total, alignment }],
                        ['Total de asistencias', { text: estudiante.general.asistencias, alignment }],
                        ['Total de faltas', { text: estudiante.general.faltas, color: 'red', alignment }],
                        ['Total de tareas entregadas', { text: estudiante.general.tareasEntregadas, alignment }],
                        ['Total de tareas no entregadas', { text: estudiante.general.tareasNoEntregadas, color: 'red', alignment }],
                        ['Tareas asignadas para entregar otro día', { text: estudiante.general.tareasOtroDia, color: 'blue', alignment }]
                    ]
                }
            },
            MATERIA: {
                width: ['16.6%', '16.6%', '16.6%', '16.6%', '16.6%', '16.6%'],
                titulo: 'INFORMACIÓN POR MATERIA',
                css: { alignment: 'center' },
                titleSpan: 6,
                getColumnas: () => {
                    return Object.entries(estudiante.materias).reduce((acc, curr) => {
                        const [horario, data] = curr;
                        acc.push([
                            horario,
                            data.materia,
                            data.docente,
                            { text: data.alumno.asistencia ? 'SI' : 'NO', color: data.alumno.asistencia ? 'black' : 'red' },
                            { text: data.alumno.tarea ? 'SI' : 'NO', color: data.alumno.tarea ? 'black' : 'red' },
                            { text: data.alumno.tareasOtroDia ? 'SI' : 'NO', color: data.alumno.tareasOtroDia ? 'blue' : 'black' }
                        ])
                        return acc;
                    }, [headers])
                }
            },
        }
        return {
            style: { bold: true, fontSize: 10, ...INFORMACION[tipo].css },
            table: {
                widths: INFORMACION[tipo].width,
                body: [
                    [
                        { text: INFORMACION[tipo].titulo, colSpan: INFORMACION[tipo].titleSpan, alignment: 'center', bold: true, fontSize: 16 },
                        ...HELPERS.crearBrs(INFORMACION[tipo].titleSpan - 1)
                    ],
                    ...INFORMACION[tipo].getColumnas(),
                ]
            }
        }
    }

    const dd = {
        header: {
            columns: [
                { image: 'LOGO_AULA_QR', width: 40, alignment: 'left', margin: [10, 10, 0, 0] },
                { image: 'LOGO_ESCUELA', width: 70, alignment: 'right', margin: [-470, 10, 10, 0] }
            ]
        },
        content: [
            HELPERS.crearBrs(2),
            { text: 'Si usted recibió este informe quiere decir que hay algo que debe revisar en el estudiante', style: 'warning' },
            HELPERS.crearBrs(1),
            { text: `ESCUELA ${estudiante.escuela}`, style: 'title' },
            { text: HELPERS.getFecha(), style: 'paragraph' },
            HELPERS.crearBrs(1),
            { text: 'Toda la información es del día especificado', alignment: 'center' },
            generarTabla('GENERAL'),
            HELPERS.crearBrs(1),
            generarTabla('MATERIA'),
            HELPERS.crearBrs(1),
            { text: 'Esta información es directamente recabada de las clases de cada docente.', alignment: 'center' },
            HELPERS.crearBrs(1),
            { text: 'Si usted recibió este informe por ERROR favor de reportarlo al 311 7436503', alignment: 'center' },

        ],
        styles: {
            warning: { color: 'red', bold: true, fontSize: 12, alignment: 'center' },
            title: { fontSize: 19, bold: true, alignment: 'center' },
            paragraph: { alignment: 'center', bold: true, fontSize: 16 }
        },
        images: {
            LOGO_AULA_QR: 'data:image/png;base64,',
            LOGO_ESCUELA: 'data:image/png;base64,'
        }

    }
    // pdfMake.createPdf(dd).download('materias.pdf');
    return pdfMake.createPdf(dd);
}

export { generatePdf }